#include <iostream>
#include <vector>
#include <algorithm>
#include <unordered_map>

/* sliding window */

int subarr_with_atmost_k(std::vector<int>& nums, int k)
{
	std::unordered_map<int, int> map;
	int	count = 0;
	int right = 0, left = 0;

	for(; right < nums.size(); ++right)
	{
		map[nums[right]] ++;
		while (map.size() > k)
		{
			map[nums[left]] --;
			if (map[nums[left]] == 0)
				map.erase(nums[left]);
			left ++;
		}
		count += right - left + 1; // basically the size of subarray
	}
	return count;
}

int subarraysWithKDistinct(std::vector<int>& nums, int k)
{
	int	sub_with_max_k = subarr_with_atmost_k(nums, k); //subarrays with k and fewer distinct elements
	int	reduced_sub_with_max_k = subarr_with_atmost_k(nums, k - 1); //subarrays with k - 1 and fewer distinct elements

	return sub_with_max_k - reduced_sub_with_max_k;
}

